  const [place, setPlace] = useState("공원");
  const [selected, setSelected] = useState("공원");
  const onChange = (e) => {
    setPlace(e.target.value);
    setSelected(e.target.value);
  };

  return (
    <>
      <MapContainer2 searchPlace={place} />
      <FormControl component="fieldset">
        <FormLabel component="legend">내 주변 상담시설</FormLabel>
        <RadioGroup aria-label="hospital" name="searchKeyword1">
          <FormControlLabel
            value="공원"
            control={<Radio color="primary" />}
            label="공원"
            onChange={onChange}
            checked={selected == "공원"}
          />
          <FormControlLabel
            value="맛집"
            control={<Radio color="primary" />}
            label="맛집"
            onChange={onChange}
            checked={selected == "맛집"}
          />
          <FormControlLabel
            value="카페"
            control={<Radio color="primary" />}
            label="카페"
            onChange={onChange}
            checked={selected == "카페"}
          />
          <FormControlLabel
            value="도서관"
            control={<Radio color="primary" />}
            label="도서관"
            onChange={onChange}
            checked={selected == "도서관"}
          />
          <FormControlLabel
            value="힐링"
            control={<Radio color="primary" />}
            label="힐링"
            onChange={onChange}
            checked={selected == "힐링"}
          />
        </RadioGroup>
      </FormControl>
      {/* <input
        type="radio"
